const handleErrors = async (response) => {
    let resp = await response
    if(!resp.ok){
        const errorMessage = {'error': resp.statusText}
        return errorMessage
    }   
}


export default async function getDish(url){
    console.log(url, "url from service")
    return await fetch(url).then(async resp => {
            const data = await resp.json()
            return await data
    })


}
